// src/ContactUs.jsx
import React from 'react';

function ContactUs() {
  return (
    <div className="container">
      <h1>Contact Us</h1>
      <p>If you have any questions about this policy or your privacy while using TrackPeek, feel free to reach out:</p>
      <p className="email">Email: support@trackpeek.app</p>
    </div>
  );
}

export default ContactUs;
